import React from 'react';
import './App.css';

const App = () => {
  const scrollTo = (sectionId) => {
    document.getElementById(sectionId).scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <div className="App">
      <div id="navbar">
        <button onClick={() => scrollTo('aboutMe')}>About Me</button>
        <button onClick={() => scrollTo('experience')}>Experience</button>
        <button onClick={() => scrollTo('projects')}>Projects</button>
      </div>

      <div id="aboutMe" className="section"></div>
      <div id="experience" className="section">Content for Section 2</div>
      <div id="projects" className="section">Content for Section 3</div>
    </div>
  );
}

export default App;
